import React from "react";
import s from "../FORM/Form.module.css"



export default function Form (){
   return (
    <div className={s.form} >
        <form >
            <label>Username:</label>
            <input type="text" />
            <label>Password:</label>
            <input type="password" />
            <button type="submit">LOGIN</button>
        </form>
    </div>
   )
}
